// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IKIP7.sol";

contract TokenFacet is IKIP7 {

    string private constant _NAME = "Definix Vote";
    string private constant _SYMBOL = "vFINIX";
    uint8 private constant _DECIMALS = 18;

   function finix() internal view returns (address finix_) {
       finix_ = LibDiamond.getAddress(keccak256(abi.encodePacked("FINIX")));
   }

    function totalSupply() external override view returns (uint256) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.totalSupply;
    }

    function totalSupplyAllTimeMint() external view returns (uint256){
         LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.totalSupplyAllTimeMint;
    }

    function totalSupplyAllTimeBurn() external view returns (uint256){
         LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.totalSupplyAllTimeBurn;
    }

    function balanceOf(address account) external override view returns (uint256){
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.balances[account];
    }

    function transfer(address recipient, uint256 amount) external override returns (bool){
        revert("VFINIX: transfer not supported");
    }

    function allowance(address owner, address spender) external override view returns (uint256){
        return LibDiamond.allowance(owner,spender);
    }

    function approve(address spender, uint256 amount) external override returns (bool){
        revert("VFINIX: approve not supported");
    }

    function transferFrom(address sender, address recipient, uint256 amount) external override returns (bool){
        revert("VFINIX: transferFrom not supported");
    }

    function safeTransfer(address recipient, uint256 amount, bytes memory data) external override{
        revert("VFINIX: safeTransfer not supported");
    }

    function safeTransfer(address recipient, uint256 amount) external override {
        revert("VFINIX: safeTransfer not supported");
    }

    function safeTransferFrom(address sender, address recipient, uint256 amount, bytes memory data) external override {
        revert("VFINIX: safeTransferFrom not supported");

    }

    function safeTransferFrom(address sender, address recipient, uint256 amount) external override{
        revert("VFINIX: safeTransferFrom not supported");

    }


    function name() public pure returns (string memory) {
        return _NAME;
    }


    function symbol() public pure returns (string memory) {
        return _SYMBOL;
    }


    function decimals() public pure returns (uint8) {
        return _DECIMALS;
    }
}
